import React from 'react'
import { useEffect, useState } from 'react'
import "../styles/Inventory.css";
import Item from "./InventoryItem";
import Button from '@mui/joy/Button';
import Add from '@mui/icons-material/Add';

function Inventory() {

  var listProps=[];
  const [addProps, setAddProps] = useState(false);
  useEffect(() => {
    listProps.map(item => {return <div className='item'>{item}</div>})
  }, [addProps,]);

  return (
    <div className='inventory'>
      <Button startDecorator={<Add />} 
              variant="outlined" 
              onClick={()=>{listProps.push(<Item/>); console.log(listProps.length);setAddProps(!addProps)}}
              style={{
                borderRadius: 30,
                padding: "18px 36px",
                fontSize: "20px"
            }}
              size="lg">Add props</Button>
    </div>
  )
}

export default Inventory
